def get_model_from_weights(weights):
    weights = get_inline_weights()
    model = QModel(256,2)

    sd = model.state_dict()

    for name in sd:
        sd[name] = torch.tensor(weights[name])

    return model

int_to_action = {
    0: "raise",
    1: "call",
    2: "fold"
}

action_to_int = {
    "raise": 0,
    "call": 1,
    "fold": 2
}

def get_valid_actions_mask(valid_actions):
    out = torch.tensor([False, False, False])
    for a in valid_actions:
        out[action_to_int[a['action']]] = True
    return out

def singleton(cls):
    instances = {}
    def get_instance(*args, **kwargs):
        if cls not in instances:
            instances[cls] = cls(*args, **kwargs)
        return instances[cls]
    return get_instance

